import React from 'react';
import { Link } from 'react-router-dom';
import { TopNavStyle } from "./style";
import styled from 'styled-components';


const TopNav = () => {
  return (
    <TopNavStyle>
      <Link to = "/" style={{ fontFamily: "Noto Sans KR", fontWeight: "bold", color: "white", textDecoration: "none" }}><h1>UOS GOODS</h1></Link>
      <Link to="/jacket" style={{ fontFamily: "Noto Sans KR", fontWeight: "bold", color: "white", textDecoration: "none" }}>  과잠  </Link>
      <Link to="/goods" style={{ fontFamily: "Noto Sans KR", fontWeight: "bold", color: "white", textDecoration: "none" }}>  굿즈  </Link>
      <Link to="/cart" style={{ fontFamily: "Noto Sans KR", fontWeight: "bold", color: "white", textDecoration: "none" }}>  장바구니  </Link>
    </TopNavStyle>
  );
};

export default TopNav;
